
[controller]
	#The sensitivity of the controller ingame
	#Range: 0.0 ~ 1.0
	ingameSensitivity = 0.4
	#Enable Controller Input?
	enableControllers = false
	#Include The guide button. Careful as enabling this with controllers that don't register the Guide Button might cause MInecraft to crash and you wouldn't be able to use your controller properly
	includeGuideButton = false
	#Select Controller 
	# Whatever controller you choose should be your controller minus 1. So that would mean controller 1 would be 0
	#Range: 1 ~ 8
	controllerNumber = 1
	#The sensitivity of the controller in the menu
	#Range: 0.0 ~ 1.0
	menuSensitivity = 0.2
	#Invert The Y-Axis
	invertYAxis = false

